import {Component} from "react";

class List extends Component{
    constructor(props){
        //positions

        super(props);

        this.renderPosition = this.renderPosition.bind(this)
        this.state = {
            //Default state initialization
        }
    }

    renderPosition(pos){
        return(
            <div>
                {pos}
            </div>
        )
    }

    render(){
        let res = []


        let posList = this.props.positions
        for (let position of posList){
            res.push(this.renderPosition(position))
        }



        return(
            res
        )

    }
}

export default List;
